import LeftNavActionType from "../actiontype/left-nav.actiontype";

export const enableAllLeftNavMenuItems = () => dispatch => {

    dispatch(enableSelfHelpClick())
    dispatch(enableArcIssueClick())
    dispatch(enableAutoPredictClick())
    dispatch(enableBlankCallClick())
    dispatch(enableCallDropClick())
    dispatch(enableFeedbackClick())
    dispatch(enableTransferClick())

}
export const disableAllLeftNavMenuItems = () => dispatch => {

    dispatch(disableSelfHelpClick())
    dispatch(disableArcIssueClick())
    dispatch(disableAutoPredictClick())
    dispatch(disableBlankCallClick())
    dispatch(disableCallDropClick())
    dispatch(disableFeedbackClick())
    dispatch(disableTransferClick())

}

//-- SELF HELP --- 
export function enableSelfHelpClick() {
    return { type: LeftNavActionType.ENABLE_SELF_HELP_CLICK };
}
export function disableSelfHelpClick() {
    return { type: LeftNavActionType.DISABLE_SELF_HELP_CLICK };
}
//-- TRANSFER --- 
export function enableTransferClick() {
    return { type: LeftNavActionType.ENABLE_TRANSFER_CLICK };
}
export function disableTransferClick() {
    return { type: LeftNavActionType.DISABLE_TRANSFER_CLICK };
}
//-- CALL DROP --- 
export function enableCallDropClick() {
    return { type: LeftNavActionType.ENABLE_CALL_DROP_CLICK };
}
export function disableCallDropClick() {
    return { type: LeftNavActionType.DISABLE_CALL_DROP_CLICK };
}
//-- BLANK CALL --- 
export function enableBlankCallClick() {
    return { type: LeftNavActionType.ENABLE_BLANK_CALL_CLICK };
}
export function disableBlankCallClick() {
    return { type: LeftNavActionType.DISABLE_BLANK_CALL_CLICK };
}
//-- FEEDBACK --- 
export function enableFeedbackClick() {
    return { type: LeftNavActionType.ENABLE_FEEDBACK_CLICK };
}
export function disableFeedbackClick() {
    return { type: LeftNavActionType.DISABLE_FEEDBACK_CLICK };
}
//-- AUTO PREDICT --- 
export function enableAutoPredictClick() {
    return { type: LeftNavActionType.ENABLE_AUTO_PREDICT_CLICK };
}
export function disableAutoPredictClick() {
    return { type: LeftNavActionType.DISABLE_AUTO_PREDICT_CLICK };
}
//-- ARC ISSUE --- 
export function enableArcIssueClick() {
    return { type: LeftNavActionType.ENABLE_ARC_ISSUE_CLICK };
}
export function disableArcIssueClick() {
    return { type: LeftNavActionType.DISABLE_ARC_ISSUE_CLICK };
}

//--- GENERAL ---- //
export function enableLeftNavItem(menuItem) {
    return {
        type: LeftNavActionType.ENABLE_LEFT_NAV_ITEM,
        payload: menuItem
    }
}
export function disableLeftNavItem(menuItem) {
    return {
        type: LeftNavActionType.DISABLE_LEFT_NAV_ITEM,
        payload: menuItem
    }
}
//--- GENERAL ---- //
